import { Component } from '@angular/core';

@Component({
  selector: 'app-graduate-and-undergraduate',
  templateUrl: './graduate-and-undergraduate.component.html',
  styleUrls: ['./graduate-and-undergraduate.component.css']
})
export class GraduateAndUndergraduateComponent {


  indexBackground:string ="assets/img/test_bg.jpg"
  BgSize:string="20px";
}
